import { Button, FormControl, Container, NavDropdown, Navbar, Nav } from "react-bootstrap";
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';

function Header() {
    let user = JSON.parse(localStorage.getItem('user-info'));
    const navigate = useNavigate();

    function logout() {
        localStorage.clear();
        navigate('/register');
    }

    return (
        <div>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Navbar.Brand href="#home">E-commerce</Navbar.Brand>
                    <Nav className="me-auto navbar_wrapper">
                        <Link to="/add" className="nav-link">Add Products</Link>
                        <Link to="/" className="nav-link">Add Products</Link>
                        <Link to="/update" className="nav-link">Update Products</Link>
                        <Link to="/login" className="nav-link">Login</Link>
                        <Link to="/register" className="nav-link">Register</Link>
                    </Nav>
                    {localStorage.getItem('user-info') ?
                        <Nav>
                            <NavDropdown title={user && user.name} id="basic-nav-dropdown">
                                <NavDropdown.Item onClick={logout}>Logout</NavDropdown.Item>
                            </NavDropdown>
                        </Nav>
                    : null}
                </Container>
            </Navbar>
        </div>
    );
}

export default Header;
